import React, { useState } from 'react'
import './Input.css'

export default props => {

    const [valor, setValor] = useState('Inicial')

    function quandoMudar(e){
        setValor(e.taget.value)
    }

    return (
        <div className="Input">
            <input value={valor} onChange={quandoMudar}/>
        </div>
    )

}
